import React from 'react';
import '../../css/Contact.css';
import '../../css/Home.css';
import mail from '../../img/donate/mail.png';
import { withTranslation } from 'react-i18next';

class Contact extends React.Component {
    render() {
        return (
            <div className="contact-container">
                <div className="contact-jumbotron">
                    <div className="contact-jumbotron-text">
                        <p>
                            {this.props.t("contact.jumbotron")}
                        </p>
                    </div>
                </div>

                <div className="contact-center">
                    <div className="grid-container bottom-margin">
                        <div className="donate-text">
                            <h1 className="donate-font-size-title-1">
                                {this.props.t("donate.title-1")}
                            </h1>
                            <p className="fb-pgh">
                                {this.props.t("donate.paragraph-1")}
                            </p>
                        </div>
                        <div className="contact-background">
                            <div className="contact-background-mail">
                                <img src={mail} alt="Email" />
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default withTranslation('common')(Contact);
